      body {
        font-family: "Open Sans", sans-serif;
        color: #2c343b;
        background-color: #f2f2f2;
        box-sizing: "border-box";
      }
    `}</style>
    <Header imageUrl="https://labs.chiedo.com/wp-content/themes/chiedolabs/img/b-logo-white.png?ver=1.11" />

    <Navbar />
    <MainSection
      tagline={
        <div>
          Your New
          <br />
          Web Developers
        </div>
